    "        \n",
    "        # Image URL\n",
    "        img_tag = product.find(\"img\")\n",
    "        img_url = img_tag[\"src\"] if img_tag else \"No Image\"\n",
    "        \n",
    "        # Product Link\n",
    "        link_tag = product.find(\"a\", href=True)\n",
    "        product_link = \"https:\" + link_tag[\"href\"] if link_tag else \"No Link\"\n",
